    - Reading
    - ! 'How do things change? How do you think things stay the same? Ms. Garcia had
      one student reflect about her previous school and how things are the same/different.  Ms.
      Garcia had several student from her first graders in the class and they too
      were able to participate in the lesson.  One first grader was able to compare
      how the work will get more difficult as she gets older. Ms. Garcia had students
      making personal connections, such as moving to a new house or a new school.
      Ms. Garcia probed her students about key vocabulary. I especially liked how
      you praised the one student as he got the word description correctly AND he
      was able to provide an example.  You had him "SHINE with his personal best!"  That
      is awesome. You did a fabulous Job of including the first grade students and
      not allowing them to skip a beat. '
    - ! 'Ms. Garcia, you did a great job of engaging your students in a group discussion.
      You can also have the students participate in a think-pair-share and then they
      can share as a table. This will allow for more intimate discussion. You did
      a great job of introducing new concepts, allow the tables to engage in more
      discussions and THEN share as a whole group. '
