    - ! 'Students participating in guided reading as a whole group. Great use of discipline
      management. Students know that a raise of the hand means to quiet down and all
      follow this. Students transition to another activity in their book with very
      little down time. Students are able to sit anywhere for their paired reading
      assignment.  Students are engaged and excited to read in pairs. Teacher is actively
      monitoring the pairs and helping where necessary. Each student has a printed
      agenda for the week and knows exactly what is expected of them. '
    - ! 'This lesson lent to a perfect opportunity to work with the struggling readers
      in a small teacher group while the other pairs where reading. Excellent job
      of bringing the students back together to debrief the paired reading. '
    - 42
