    - ! 'Using the smart board to review Stanford strategies.  Students were doing
      a quick think pair share to discuss characters of a story.  They discussed the
      differences in the characters of the story.Questions:  students choral reading
      questions to teacher from paperwork and smartboard. Students:  students think
      pair share where to find answers to questions and what strategies to use.  Students
      were giving answers to questions and what were clues to assist to find the answers.
      I like the way you asked who got this answer right, but also asked the students
      that did not get answer correct what they chose as an answer and allowed them
      to try to defend their answer.All students are on task and paying attention.  Everyone
      choral reading and answering...'
    - ! 'It might have been helpful to number the paragraphs as a group before you
      start answering questions.  The reason I say this is because you asked what
      paragraph did you find your answer in...  You also might want to allow the students
      to manipulate the smart board, not just all teacher directed.  '
