    - ! 'Ms. Castillo had her students going over characteristics of a poem. She was
      reviewing small verses and asking students to highlight words/phrases that rhyme.  Students
      were able to tell Ms. Castillo  the purpose of the poem. Ms. Castillo had her
      students making predictions about the comic strip and then defend their responses
      with evidence. Students were excepted to describe the scene and point out details.
      You did an amazing job of correcting students (as you asked several students
      to sit up and or pay attention) without skipping a beat. You emphasized how
      you wanted them to wake up and respond quickly, which is awesome! No time to
      waste! The pace of your lesson was amazing. You did not waste a minute and touched
      on several concepts. Great job! '
    - ! 'You did a great job of highlighting characterization and had the students
      use complete sentences. You can also highlight synonyms of "baby words" such
      as sad, mad, happy. The kids can start using words, such as, upset, glad, delighted...
      This is a suggestions that I used with my ELA classes. I had a list of "big
      words" and they soon started to use them. '
