    - ! 'All students are on task and copying the vocabulary words on the board. Students
      give the OK signal when they have completed copying the vocabulary words and
      wait patiently for the next directive. It is apparent that the students understand
      the expectations in the classroom. Several students closed their eyes during
      while the teacher read the story and were excited as the story went on. Several
      even silently acted out the story as it went on. '
    - ! 'This vocabulary assignment would lent itself well towards having students
