    - ! 'Students were lined up reading sight words. 15 students were seated at their
      desk and 7 students were lined up practicing reading. This is a great idea to
      have the kids reading aloud and actually racing to the read the word first.
      New words for the week: do, that,and are.  Students were asked why they need
      to know sight words and students were able to tell Ms. Westphal that they want
      to go to first grade. In fact, she was able to emphasize the difference between
      sound spelling and sight words. Which they were able to grasp. Students were
      able to clap and spell the words and say the word aloud. Ms. Westphal, you have
      a great learning environment and your kids enjoyed the lesson when you had them
      up and clapping. Students were also excited to use their sight words in a complete
      sentence and were excited to share out. Students were also asked to use the
      words in a question. '
    - ! 'Having the kids read aloud is a fabulous idea; however, you also have to
      have the other kids engaged. Perhaps you can have the kids have mini sets of
      flash cards and have them practice with a partner.  They can pretend to be a
      teacher and take turns. You did a great job of posing questions to your students
      but you had the same students raising their hand wanting to share out. Perhaps
      you can use the "go around cup" strategy? This will ensure that you target all
      your students and keep them on their toes. '
