    - ! 'Students were asked to use the vocabulary words in their own sentence. Mr.
      Centeno asked the students to use the word they were provided to write their
      sentences and use original sentences. Students were completing their sentences
      quickly, so he then asked students to write more sentences if they could. I
      especially liked how you encouraged your students to make mistakes, so you could
      help direct their learning. Which is awesome. Our students need to feel comfortable
      and willing to learn from their mistakes! Once students were finished, students
      were asked to tour the room and share their sentences. I especially like how
      you set the classroom expectations and shared how we were here to help it peers
      and encourage our learning together NOT laugh or judge one another. Words: posesion,
      telar, pleito, madeja. Students were provided a flash card with the word and
      details about the word. Thank you for using your visual timer to provide an
      actual countdown for students. This helps students stay grounded and focused
      with their learning. '
    - ! 'Have students use the word in a form of a question, as this will help challenge
      their learning. You also had some students write multiple sentences, perhaps
      you could have given them a shout out for writing multiple sentences. You could
      have asked them who wrote 10 sentences, who wrote 9, etc. Encourage your students
      to use expression while reading because you had some students reading without
      expression and sounded monotone. Perhaps you can show them the difference, as
      this will help them understand the difference. '
