    - ! 'Antonym lessons.  Sharp and dull.  They are sentence surgeons.  Teacher will
      place sentence on smart board and they have to use antonyms to recreate a new
      sentence.  Then they will write it on the sentence strip.  Once they have their
      new antonym they will use a smaller piece and replace that older work and use
      a band aide to hold new words on sentence strip.  Curtis went around assisted
      students with words, making capital letter corrections, and punctuation errors.
      Students were able to recall antonyms from previous lessons.  Students used
      a worksheet about being sentence surgeons, to assist with next part of the lesson.Transition:
      from floor to desk less than 30 seconds.Students are very eager to make a sentence
      and change the antonym.  Student comments:Ms. Curtis is the best teacher ever.  I
      bet the other first graders don''t get to use real band aides.  I feel sorry
      for them.  Such a great lesson!  Your kids are so charged up about being sentence
      surgeons!'
    - ! 'Maybe an extension could be to draw pictures of their antonyms.  '
